        /// <summary>
        /// Vérifie l'ajout d'une photo lorsque les informations fournies sont valides
        /// </summary>
        [TestMethod]
        public void CreatePicture_GoodValues_OK()
        {
            var testCreatePictureDTO = new CreatePictureDTO()
            {
                Base64 = _base64Ok,
                PostId = 1
            };

            var config = new HttpConfiguration();
            var request = new HttpRequestMessage(HttpMethod.Post, "http://localhost/api/Picture/CreatePicture");
            var route = config.Routes.MapHttpRoute("DefaultApi", "api/{controller}/{id}");
            var routeData = new HttpRouteData(route, new HttpRouteValueDictionary { { "controller", "Pictures" } });

            _controller.ControllerContext = new HttpControllerContext(config, routeData, request);
            _controller.Request = request;
            _controller.Request.Properties[HttpPropertyKeys.HttpConfigurationKey] = config;
            var response = _controller.CreatePicture(testCreatePictureDTO);

            Assert.AreEqual(request.CreateResponse(HttpStatusCode.OK).StatusCode, response.StatusCode);
        }

        /// <summary>
        /// Vérifie l'exception lors de la tentative d'ajout d'une photo lorsque l'image est vide
        /// </summary>
        [TestMethod]
        public void CreatePicture_NoValue_KO()
        {
            var testCreatePictureDTO = new CreatePictureDTO()
            {
            };

            var config = new HttpConfiguration();
            var request = new HttpRequestMessage(HttpMethod.Post, "http://localhost/api/Picture/CreatePicture");
            var route = config.Routes.MapHttpRoute("DefaultApi", "api/{controller}/{id}");
            var routeData = new HttpRouteData(route, new HttpRouteValueDictionary { { "controller", "Pictures" } });

            _controller.ControllerContext = new HttpControllerContext(config, routeData, request);
            _controller.Request = request;
            _controller.Request.Properties[HttpPropertyKeys.HttpConfigurationKey] = config;
            var response = _controller.CreatePicture(testCreatePictureDTO);

            Assert.AreEqual(request.CreateResponse(HttpStatusCode.BadRequest, "Il n'y a pas d'image").ReasonPhrase, response.ReasonPhrase);
        }

